import 'bootstrap/dist/css/bootstrap.css'
import LoginForm from './components/LoginForm'
import {Container, Row} from "react-bootstrap";


function App() {
  return (
      <div className="App">
        <h1>Hi!</h1>
            <Container>
                <Row className='justify-content-center'>
                    <LoginForm/>
                </Row>
            </Container>
      </div>
  );
}

export default App;
